      String? status, 
      String? message, 
      List<TrendingSearchData>? result,}){
    _status = status;
    _message = message;
    _result = result;
}

  TrandingSearchModel.fromJson(dynamic json) {
    _status = json['status'];
    _message = json['message'];
    if (json['result'] != null) {
      _result = [];
      json['result'].forEach((v) {
        _result?.add(TrendingSearchData.fromJson(v));
      });
    }
  }
  String? _status;
  String? _message;
  List<TrendingSearchData>? _result;
